import React, { Component } from 'react'
import {useSpring} from 'react-spring';

export default class App extends Component {
  render() {
    const props = useSpring({color:"#ff0000", from:  {color:"#0000ff"},})
    return (
      <div>
        <h1 style={props}> hello world</h1>
      </div>
    )
  }
}
